description:
Сендвичница 4в1, что еще нужно - ничего не подгарает, все пропекаеться как следует. Просто отменный прибор, и тостер, и гриль, и орешница. Простые вкусные блюда быстро и качественно, всегда свежая еда на столе. Хотите панини, а может сосиски-гриль? А может сладких орешков или горячих бутербродов? Возможно деруны или толстые вафли? Выпечка происходит быстро, т.к. 1000Вт вполне достаточно для домашнего приготовления. Для каждого блюда отдельные съемные формы, что удобно при чистке вафельницы.

Она имеет световую индикацию работы, означающие готовности к выпеканию или поджариванию. С каждой стороны прибора размещены нагревательные элементы в виде пластин которые соприкасаются с приготовляемыми продуктами сверху и снизу - это обеспечивает быструю и равномерную готовку в бутерброднице 4в1 Domotec Ms 7704. Нет необходимости переворачивать продукты как в сковороде.

Каждая пластина с антипригарным покрытием, поэтому Вы можете не беспокоиться о том, что какой-нибудь продукт пригорит. В данной модели Вы сможете приготовить не только сэндвичи, бутерброды и вафельки, но и другие блюда – пирожки из слоёного теста, например, или маленькие треугольные пиццы. Всё зависит от Вашей фантазии и продуктов, которые есть в вашем холодильнике.

Имеет четыре вида насадок, размер насадок ― 13 на 22 см.

"Вафли гофре" ― приготовление ароматных брюссельских или бельгийских вафель, которые станут отличным десертом, или заменят на завтрак привычные оладьи.
"Сэндвичи" ― используя тостерный хлеб прямоугольной формы, вы приготовите настоящие английские сэндвичи со всевозможными начинками. Во время приготовления они разделяются на красивые треугольные кусочки.
"Гриль" ― универсальная насадка. Ее ребристая поверхность создает аппетитный рисунок в виде полос. Подрумянить сосиски, кусочки хлеба, лаваш и даже приготовить яичницу ― те немногие вещи, которые может настоящий гриль.
"Орешница" ― позволит насладится вам ароматной выпечкой кондитерских изделий в форме ореховой скорлупы, с вкусными начинками из сгущенки или крема.

Характеристики:
- сьемные формы для сендвичей, вафель, гриля и орешков;
- корпус из нержавеющей стали;
- корпус с охлаждением;
- антипригарные покрытия-формы;
- легко очистить;
- ручки с теплоизоляцией;
- ручко-замковая система;
- терморегулирование;
- предохранительный термовыключатель и термопредохранитель;
- 2 контрольных лампы для питания и обогрева;
- вертикальное основание для хранения;
- электропитание 220-230В, 50-60 Гц

Прибор обладает мощностью 1000 Вт, оснащен двумя светодиодными индикаторами работы, автоматическим термостатом, что обеспечивает постоянную поддержку температуры и защиту от перегрева. Корпус выполнен из высококачественной нержавеющей стали. Сменные формы пластины легко чистятся и моются. Не нагревающиеся термоизоляционный ручки, с замковой системой.

